import React from 'react';
import API from '../Api';
import axios from 'axios';
import TextField from '@material-ui/core/TextField';
import deepOrange from '@material-ui/core/colors/deepOrange';
import {DataTable,Column} from 'primereact/datatable';

class BienesApi extends React.Component {
    
    constructor() {
        super();
        this.state = { fiduca: {data:[]} };
        
    }

    llamada() {
        return axios.get('http://127.0.0.1:7101/FiduciaWeb/getRef.do?json={"id":"funRegistroGarantias"}')
               .then(res => res);
    }

    componentDidMount() {
        
        this.llamada().then(data => {
            //console.log('JSON: ' + JSON.stringify(data));
            this.setState({fiduca: data});
        });
        
    }
    
    render() {
        console.log('JSON: ' + JSON.stringify(this.state.fiduca.data));
        //const { fiduca } = thi
        return(
            <div>
                <DataTable value={this.state.fiduca.data}>
                    <Column field="fgarIdFideicomiso" header="FIso" />
                    <Column field="fgarCveGarantia2" header="Year" />
                </DataTable>
            </div>
        );
    }
}
export default BienesApi;
